INSERT INTO `core_expert` VALUES (234, '14361202752', '', NULL, '', NULL, '\n\n,\nBangWang\nPh.D.,Professor\nSchoolofElectronicInformationandCommunications(EIC)\nHuazhongUniversityofScienceandTechnology(HUST)\nHome\nShortBio\nEducation\nPatents\nBangWang\nPh.D.,Professor\nADDRESS\nSchoolofElectronic,InformationandCommunications\nChina,430074\n\n\nE-MAIL\nWeb\nShortBio\nDr.BangWangobtainedhisB.E.andM.S.fromtheDepartmentofElectronicsandInformationEngineeringofHuazhongUniversityofScienceandTechnology(HUST)Wuhan,Chinain1996and2000,respectively,andhisPhDdegreeinElectricalandComputerEngineering(ECE)DepartmentofNationalUniversityofSingapore(NUS)Singaporein2004.HeisnowworkingasaprofessorintheSchoolofElectronic,InformationandCommunications,HUST.Hisresearchinterestsarenowwithinthefieldofwirelessnetworks,localizationtechniques,recommendationalgorithms,computationalcommunications,andknowledgegraphs.Dr.Wanghasover100technicalpublications,including7patents,2books,7bookchaptersandover110researcharticlesininternationalconferencesandjournals,suchasACMComputingSurveys,IEEEWirelessCommunications,IEEETrans.onAntennasandPropagation,IEEETrans.onComputers,IEEETrans.onIndustrialElectronics,IEEETrans.onIndustrialInformatics,IEEETrans.onMobileComputing,IEEETrans.onParallelandDistributedSystems,IEEETrans.onVehicularTechnology,IEEETrans.onWirelessCommunications,andetc.\nEducation\nJuly2000Oct.2004.\nPh.D.\nElectricalandComputerEngineeringDepartment,NationalUniversityofSingapore(NUS),Singapore\nSept.1997Jun.2000.\nM.Sci.\nElectronicsandInformationEngineeringDepartment,HuazhongUniversityofScienceandTechnology(HUST),Wuhan,China\nSept.1992Jun.1996.\nB.Eng.\nElectronicsandInformationEngineeringDepartment,HuazhongUniversityofScienceandTechnology(HUST),Wuhan,China\nNov.2015Present.\nProfessor\nSchoolofElectronicInformationandCommunications,HuazhongUniversityofScienceandTechnology(HUST),Wuhan,China\nNov.2010Oct.2015.\nSchoolofElectronicInformationandCommunications,HuazhongUniversityofScienceandTechnology(HUST),Wuhan,China\nJan.2007.Oct.2010.\nIntelligentSystemsCentre(IntelliSys),NanyangTechnologicalUniversity,Singapore\nJuly.2006.Dec.2006.\nCommunicationandNetworkingDivision,PanasonicSingaporeLaboratory,Singapore\nJan.2005.July.2006.\nElectricalandComputerEngineeringDepartment,NationalUniversityofSingapore(NUS),Singapore\nFeb.2004.Dec.2004.\nJan.2001.Dec.2001.\nJuly.1996.July.1997.\nElectronicsandInformationEngineeringDepartment,HuazhongUniversityofScienceandTechnology(HUST),Wuhan,China\nBooks\nJournalPapers(IF17/5Y:ImpactFactor2017/5-Year):\nConferencePapers:\nPatents:\n\n', 'images/default_user_icon.jpg', 'http://www.kejso.com/scholar/14361202752', '18627086102', '2022-05-08 00:56:13.983560', NULL, NULL, ' ');
